import React from "react";
import { Routes, Route } from "react-router-dom";

function Header() {
  return (
    <Routes>
      <Route>
        <div className="w-full bg-gray-400 flex justify-between p-4">
          <div>
            <h1 className="text-2xl font-bold font-sans">Project 1</h1>
          </div>

          <div>
            <div className="flex justify-between text-xl font-bold font-sans">
              <button className="border-black border-2 rounded-md px-2 py-1 mx-2">
                Login
              </button>
              <button
                className="border-black border-2 rounded-md px-2 py-1 mx-2"
                onClick={() => {
                  <Route path="/Login" />;
                }}
              >
                SignUp
              </button>
            </div>
          </div>
        </div>
      </Route>
    </Routes>
  );
}

export default Header;
